              card.UserName.includes(e.target.value) ||
              card.Email.includes(e.target.value)
          );
      
          setSearchResulte(resultsArray);
        };

  return (
    <div>
      <HeaderSupervisor />
      <div className="main-div">
        <div className="Supervise-box">

        </div>
        <GuideNav />
      </div>
      <WebsiteFooter />
    </div>
  );
};

export default SuperviseStudents;
